def solution(A, B, M, X, Y):    count = 0    weight = 0    into = 0    elevator = set()    for i in range(len(A)):        if Y >= (weight + A[i]) and X >= (into + 1):            weight += A[i]            into += 1            elevator.add(B[i])        else:            count += len(elevator) + 1            elevator.clear()            weight = A[i]            into = 1            elevator.add(B[i])    count += len(elevator) + 1    return count# test = solution([10,10,10],[2,2,2],5,3,200)# print(test)